Input: Refer to the nextIntInRangemethod below:
 /** @return a random integer in the range low to high, inclusive */
 public int nextIntInRange(int low, int high)
 {
 return /* expression */
 }
 Which /* expression */ will always return a value that satisfies the postcondition? Choices: a) (int) (Math.random() * high) + low; b) (int) (Math.random() * (high - low)) + low; c) (int) (Math.random() * (high - low + 1)) + low; d) (int) (Math.random() * (high + low)) + low; 
Output:
First, I need to understand the postcondition, which is that the returned value should be a random integer in the range low to high, inclusive.
Next, I need to analyze each choice to see which one satisfies the postcondition.
Choice a) (int) (Math.random() * high) + low: This expression will generate a random number between 0 and high, and then add low to it. However, this will not include the value high, so it does not satisfy the postcondition.
Choice b) (int) (Math.random() * (high - low)) + low: This expression will generate a random number between 0 and high - low, and then add low to it. However, this will not include the value high, so it does not satisfy the postcondition.
Choice c) (int) (Math.random() * (high - low + 1)) + low: This expression will generate a random number between 0 and high - low + 1, and then add low to it. This will include the value high, so it satisfies the postcondition.
Choice d) (int) (Math.random() * (high + low)) + low: This expression will generate a random number between 0 and high + low, and then add low to it. However, this will not include the value high, so it does not satisfy the postcondition.
Therefore, the correct answer is {'sol': 'c'}
